import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import NavBar from './src/components/NavBar';
import Home from './src/components/Home';
import Predictions from './src/components/Predictions';
import ElectionData from './src/components/ElectionData';
import News from './src/components/News';
import Tweets from './src/components/Tweets';
import InstagramPosts from './src/components/InstagramPosts';
import Login from './src/components/LogIn';
import SignUp from './src/components/SignUp';
import Chatbot from './src/components/Chatbot';
import AdminComplaintsPage from './src/components/AdminComplaintPage';
import ComplaintForm from './src/components/ComplaintForm';
import { AuthProvider } from './src/components/AuthContext';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import 'bootstrap/dist/css/bootstrap.min.css';

function ProtectedRoute({ isAdmin, children }) {
  if (!isAdmin) {
    return <Navigate to="/login" />;
  }
  return children;
}

function App() {
  const [isAdmin, setIsAdmin] = useState(false);

  useEffect(() => {
    // Check if user is admin from local storage or session
    const adminStatus = localStorage.getItem('isAdmin') === 'true';
    setIsAdmin(adminStatus);
  }, []);

  return (
    <AuthProvider>
      <Router>
        <div>
          <NavBar />
          <Routes>
            <Route path="/" element={<Navigate to="/home" />} />
            <Route path="/home" element={<Home />} />
            <Route path="/predictions" element={<Predictions />} />
            <Route path="/election-data" element={<ElectionData />} />
            <Route path="/news" element={<News />} />
            <Route path="/tweets" element={<Tweets />} />
            <Route path="/instagram-posts" element={<InstagramPosts />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/chatbot" element={<Chatbot />} />
            <Route path="/submit-complaint" element={<ComplaintForm />} />
            <Route
              path="/seeComplaints"
              element={
                <ProtectedRoute isAdmin={isAdmin}>
                  <AdminComplaintsPage />
                </ProtectedRoute>
              }
            />
            {/* Optionally, redirect any other route to home page */}
            <Route path="*" element={<Navigate to="/home" />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
